import { Routes, Route } from 'react-router-dom';
import Home from './routes/home/home.jsx';

const App = () => {

  const Shop = () => {
    return (
      <h1>I am the shop page.</h1>
    )
  }

  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/shop" element={<Shop />} />
    </Routes>
  );
}

export default App;
